import React from 'react';
import '../../styles/allPages.css';

const NotFoundPage = () => {
    return (
        <div className='left'>
            <div className="container">
                <h1 className='title'>404 - Page Not Found</h1>
            </div>
        </div>
    );
}

export default NotFoundPage;
